export class EmpClaim {
   id: string;
   claimId: string;
   claimOption: string; // Direct/ Non-Direct
   csn: string;
   occupn: string;
   commenceDate: Date;
   resignationDate: Date;
   startPayPeriod: string; // Entity data type is int
   halfDayInd: string;
   lastApprBy: string;
   invalidAddressIndicator: string;

   blkNo: string;
   street: string;
   unitNo: string;
   building: string;
   postalCode: string;

   certRole: string;
   certName: string;
   certSalutation: string;
   certAppt: string;
   certContactNo: string;
   certContactExt: string;
   certEmail: string;
   certFax: string;

   eClaimId: string; // self-reference
   initialEmpClaimId: string;
   
   creadtedBy: string;
   createdDt: Date;
   updatedBy: string;
   updatedDt: Date;
   
   cpfSnapshotList: cpfSnapshot[];
   empClaimHardcopyList: EmpClaimHardcopy[]; 
}

export class EmpClaimHardcopy {
    id: string;
	empClaimId: string;
	basis: string;
	status: string;
	formulaCode: string;
    empClaimHardcopyItemList: EmpClaimHardcopyItem[];
}

export class EmpClaimHardcopyItem {
    id: string;
    empClaimHardcopyId: string;
    itemName: string;
    itemType: string;
}

export class cpfSnapshot {
    id: string;
    nric: string;
    csn: string;
    startYearMonth: Date;
    endYearMonth: Date;
    prepopulatedInd: string;
    cpfSnapDate: Date;
    latestContributionYearMonth: Date;
    cpfSnapshotInfoList: CpfSnapshotInfo[];
    createdBy: string;
    createdDt: Date;
    updatedBy: string;
    updatedDt: Date;
}

export class CpfSnapshotInfo {
    id: string;
    owAmount: number;
    awAmount: number;
    relevantContributionYearMonth: Date;
    cpfSnapDate: Date;
    latestContributionYearMonth: Date;
  }
